import Todos from './components/Todos';
import Todo from './models/todo';

function App() {
  const todos = [new Todos('Learn React'), new Todo('Learn TypeScript')];
  return (
    <div>
      <Todos items={['Learn React', 'Learn TypeScript']} />
    </div>
  );
}

export default App;
